      {
        &quot;product&quot;: &quot;62ac8176ddb08e6ee5f2c7cd&quot;,
        &quot;amount&quot;: 1
      },
      {
        &quot;product&quot;: &quot;62ac8181ddb08e6ee5f2c7d0&quot;,
        &quot;amount&quot;: 1
      }
    ],
    &quot;createdAt&quot;: &quot;2022-06-17T13:28:48.815Z&quot;,
    &quot;updatedAt&quot;: &quot;2022-06-17T13:39:44.073Z&quot;,
    &quot;orderNumber&quot;: 82,
    &quot;__v&quot;: 2
  }
</code></pre>
<p>And a query to update second element of <code>productsInOrder</code> array in the document</p>
<pre class="lang-js prettyprint-override"><code>db.collection.findOneAndUpdate({
  status: &quot;NEW&quot;,
  vendor: &quot;62ac8171ddb08e6ee5f2c7ca&quot;,
  &quot;productsInOrder.product&quot;: &quot;62ac8181ddb08e6ee5f2c7d0&quot;,
  &quot;productsInOrder.amount&quot;: {
    $lte: 3
  },

},
{
  $inc: {
    &quot;productsInOrder.$.amount&quot;: 1
  }
})
</code></pre>
<p>After executing the update query I expect product with id <code>&quot;62ac8181ddb08e6ee5f2c7d0&quot;</code> to be updated, i.e it's amount increased by 1</p>
<pre class="lang-js prettyprint-override"><code>{
    &quot;_id&quot;: &quot;62ac8190ddb08e6ee5f2c7dd&quot;,
    &quot;status&quot;: &quot;NEW&quot;,
    &quot;vendor&quot;: &quot;62ac8171ddb08e6ee5f2c7ca&quot;,
    &quot;productsInOrder&quot;: [
      {
        &quot;product&quot;: &quot;62ac8176ddb08e6ee5f2c7cd&quot;,
        &quot;amount&quot;: 1
      },
      {
        &quot;product&quot;: &quot;62ac8181ddb08e6ee5f2c7d0&quot;,
        &quot;amount&quot;: 2 // increased by 1
      }
    ],
    &quot;createdAt&quot;: &quot;2022-06-17T13:28:48.815Z&quot;,
    &quot;updatedAt&quot;: &quot;2022-06-17T13:39:44.073Z&quot;,
    &quot;orderNumber&quot;: 82,
    &quot;__v&quot;: 2
  }
</code></pre>
<p>but instead product with id <code>&quot;62ac8176ddb08e6ee5f2c7cd&quot;</code> gets updated as seen here <a href="https://mongoplayground.net/p/UEU5LCAVjD0" rel="nofollow noreferrer">https://mongoplayground.net/p/UEU5LCAVjD0</a></p>
<p>I don't understand why positional operator selects the first element of the array instead of the element specified in find query</p>
<p>How can I update array element of the same <code>id</code> that is specified in find query in `&quot;productsInOrder.product&quot;?</p>

