How to delete ($pull) nested array elements with property value null in arrays with more than one element<p>I would like to delete (<code>$pull</code>) nested array elements where one of the element's properties is null and where the array has more than one element.</p>
<p>Here is an example. In the following collection, I would like to delete those elements of the <code>Orders</code> array that have <code>Amount</code> = <code>null</code> and where the <code>Orders</code> array has more than one element. That is, I would like to delete only the element with <code>OrderId</code> = 12, but no other elements.</p>
<pre><code>db.TestProducts.insertMany([
    {
        ProductDetails: { &quot;ProductId&quot;: 1, Language: &quot;fr&quot; },
        Orders: [
            { &quot;OrderId&quot;: 11, &quot;Amount&quot;: 200 },
            { &quot;OrderId&quot;: 12, &quot;Amount&quot;: null }
        ]
    },
    {
        ProductDetails: { &quot;ProductId&quot;: 2, Language: &quot;es&quot; },
        Orders: [
            { &quot;OrderId&quot;: 13, &quot;Amount&quot;: 300 },
            { &quot;OrderId&quot;: 14, &quot;Amount&quot;: 400 }
        ]
    },
    {
        ProductDetails: { &quot;ProductId&quot;: 3, Language: &quot;en&quot; },
        Orders: [
            { &quot;OrderId&quot;: 15, &quot;Amount&quot;: null }
        ]
    }
]);
</code></pre>
<p>The following attempt is based on googling and a combination of a few other StackOverflow answers, e.g. <a href="https://stackoverflow.com/a/35230056/2274701">Aggregate and update MongoDB</a></p>
<pre><code>db.TestProducts.aggregate(
    [
        { $match: { &quot;Orders.Amount&quot;: { &quot;$eq&quot;: null } } },
        { $unwind: &quot;$Orders&quot; },
        {
            &quot;$group&quot;: {
                &quot;_id&quot;: {
                    ProductId: &quot;$ProductDetails.ProductId&quot;,
                    Language: &quot;$ProductDetails.Language&quot;
                },&quot;count&quot;: { &quot;$sum&quot;: 1 }
            }
        },
        { &quot;$match&quot;: { &quot;count&quot;: { &quot;$gt&quot;: 1 } } },
        { &quot;$out&quot;: &quot;temp_results&quot; } 
    ],
    { allowDiskUse: true}
);


db.temp_results.find().forEach((result) =&gt; {
    db.TestProducts.updateMany({&quot;ProductDetails.ProductId&quot;: result._id.ProductId, &quot;ProductDetails.Language&quot;: result._id.Language }, 
        { $pull: { &quot;Orders&quot;: {&quot;Amount&quot;: null } }})
});
</code></pre>
<p>This works, but I am wondering if it can be done in a simpler way, especially if it is possible to delete the array elements within the aggregation pipeline and avoid the additional iteration (<code>forEach</code>).</p>

