A way to persist the same/unique id generated for crypto.randomUUID in a user on nodeJS?<p>I'm developing a web app where I need to give the user a unique ID for him, I searched and used the crypto module to generate UUID and it works, here is the code for that (I'm sending it with my res.render of products).</p>
<pre><code>import Product from '../models/Products';
const crypto = require('crypto');

const getProducts = async (req, res) =&gt; {
  const products = await Product.find().lean();

  const idValueUser = crypto.randomUUID();
  console.log(idValueUser);

  res.render('products/products', { layout: 'products-lyt',
                                    products: products, 
                                    userId: idValueUser});
};


module.exports = getProducts;
</code></pre>
<p>I'm passing to handlebars file the userId by the render and in the javascript of the file I pass that Id to the local storage:</p>
<pre><code>&lt;div class=&quot;container-fluid products-container&quot;&gt;
    &lt;div class=&quot;products-columns&quot;&gt;
        {{#each products}}
        {{&gt; products-partial }}
        {{/each}}
    &lt;/div&gt;

        &lt;p id=&quot;awadetest&quot;&gt;{{userId}}&lt;/p&gt;
&lt;/div&gt;

&lt;script&gt;
    var testeo = document.getElementById(&quot;awadetest&quot;).innerHTML;
    console.log(testeo);
    localStorage.setItem(&quot;test&quot;, testeo);
&lt;/script&gt;
</code></pre>
<p>The Id pass correctly to the localStorage (which I'll send to the database by a form after) but the problem is that every time the user reload (make a petition to the page of products) the id change (logically) but I need a way to make that Id persist so I can identify the user after on the Database, someone knows a way to do that? or if exist a better way to identify the user that doesn't imply log in or use the IP, btw thanks</p>

